"""Finally, let's build the psychometric curves to compare the robustness of each model to adversarial fgsm attacks of different "strengths":"""

epsilon_values = [0, 0.05, 0.10, 0.15, 0.20, 0.25, 0.3]

def test_epsilon_values_effect(model, n_steps):
  accuracies = list()

  for eps in epsilon_values:
      acc = test_robustness_to_attack(model, device, test_loader, eps, num_steps=n_steps, verbose=False)
      accuracies.append(acc)

  return accuracies

